}
/*
onClick後 會去後端拉資料 顯示在前端
*/
/*
next : json Server資料 放在表單
*/ 
const List = ({data})=>{
    
    const users = [
        {name:"Pedro",age:21},
        {name:"Hope",age:23}
    ]
    
    return <div className="list">
        {users.map((user)=>{
            return(
                <div>
                    {user.name} {user.age} 
                </div>
            )
        })}
    </div>     
}

export default List;
